  <>
    <NavBar />
    <img className="text-center w-8/12 ml-auto mr-auto" src="https://res.cloudinary.com/db3njhxi0/image/upload/v1644634655/U-Dance/WhatsApp_Image_2022-02-11_at_9.56.11_PM_iwu2a1.jpg" alt="" />
